void parse(stringstream &input, vf &output) {
	int dim;
	input >> dim;
	
	assert(dim == 1);
	assert(output.size() == 0);

	int d1;
	input >> d1;

	for (int i = 0; i < d1; i++) {
		float v;
		input >> v;
		output.push_back(v);
	}
}

void parse(stringstream &input, vffff &output) {
	int dim;
	input >> dim;
	
	assert(dim == 4);
	assert(output.size() == 0);

	int d1, d2, d3, d4;
	input >> d1 >> d2 >> d3 >> d4;

	for (int i = 0; i < d1; i++) {
		vfff partial1;
		for (int j = 0; j < d2; j++) {
			vff partial2;
			for (int k = 0; k < d3; k++) {
				vf partial3;
				for (int q = 0; q < d4; q++) {
					float v;
					input >> v;
					partial3.push_back(v);
				}
				partial2.push_back(partial3);
			}
			partial1.push_back(partial2);
		}
		output.push_back(partial1);
	}
}

int padding = 2;
vfff conv2d(vfff &input, vffff &filter, vf &strides) {
	// Zeroed output array
	vfff output = vfff(input.size(), vff(input[0].size(), vf(filter[0][0][0].size(), 0)));

	for (int i = 0; i < output.size() - 2*padding; i++) {
		for (int j = 0; j < output[0].size() - 2*padding; j++) {
			for (int k = 0; k < output[0][0].size(); k++) {
				float acc = 0;

				for (int di = 0; di < filter.size(); di++) {
					for (int dj = 0; dj < filter[0].size(); dj++) {
						for (int q = 0; q < filter[0][0].size(); q++) {
							acc += input[strides[1] * i + di][strides[2] * j + dj][q] * filter[di][dj][q][k];
						}
					}
				}

				output[i + padding][j + padding][k] = acc;
			}
		}
	}

	return output;
}

void add(vfff &data, vf &val) {
	itervfff(i, j, k, data, padding) {
		data[i][j][k] += val[k];
	}
}

void div(vfff &data, float val) {
	itervfff(i, j, k, data, padding) {
		data[i][j][k] /= val;
	}
}

void relu(vfff &data) {
	itervfff(i, j, k, data, padding) {
		data[i][j][k] = max(data[i][j][k], 0.0f);
	}
}

float sum(vfff &data) {
	float acc = 0;
	itervfff(i, j, k, data, padding) {
		acc += data[i][j][k];
	}
	return acc;
}

void normalize(vfff &data) {
	div(data, sum(data));
}

void softmax(vfff &data) {
	itervfff(i, j, k, data, padding) {
		data[i][j][k] = exp(data[i][j][k]);
	}

	normalize(data);
}


vf strides = { 1, 1, 1, 1 };

int main () {
	stringstream ss;

	ss.str(W_conv1_data);
	vffff W_conv1;
	parse(ss, W_conv1);

	ss.str(b_conv1_data);
	vf b_conv1;
	parse(ss, b_conv1);

	ss.str(W_conv2_data);
	vffff W_conv2;
	parse(ss, W_conv2);

	ss.str(b_conv2_data);
	vf b_conv2;
	parse(ss, b_conv2);

	ss.str(W_conv3_data);
	vffff W_conv3;
	parse(ss, W_conv3);

	ss.str(b_conv3_data);
	vf b_conv3;
	parse(ss, b_conv3);

	ss.str(W_conv4_data);
	vffff W_conv4;
	parse(ss, W_conv4);

	ss.str(b_conv4_data);
	vf b_conv4;
	parse(ss, b_conv4);


	vfff input = vfff(19 + padding*2, vff(19 + padding*2, vf(5, 0)));
	for (int x = 0; x < 19; x++) {
		for (int y = 0; y < 19; y++) {
			input[y + padding][x + padding][3] = (x/(19.0f - 1)) - 0.5f;
			input[y + padding][x + padding][4] = (y/(19.0f - 1)) - 0.5f;
		}
	}

	// Layer 1
	auto last = conv2d(input, W_conv1, strides);
	add(last, b_conv1);
	relu(last);

	/*itervfff(i, j, k, last, padding) {
		if (k == 0) {
			cout << last[i][j][k] << " ";
		}
	}*/

	// Layer 2
	last = conv2d(last, W_conv2, strides);
	add(last, b_conv2);
	relu(last);

	// Layer 3
	last = conv2d(last, W_conv3, strides);
	add(last, b_conv3);
	relu(last);

	// Layer 4
	last = conv2d(last, W_conv4, strides);
	add(last, b_conv4);
	relu(last);

	// Layer 5
	softmax(last);

	assert(last.size() == 19 + 2*padding);
	assert(last[0].size() == 19 + 2*padding);
	assert(last[0][0].size() == 1);

	itervfff(i, j, k, last, padding) {
		cout << last[i][j][k] << " ";
	}
	return 0;
}